import React from 'react';
import Frame70 from './Frame70';

const Banner = () => {
  return (
    <div
      style={{
        width: '100%',
        maxWidth: '1440px',
        height: '500px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        overflow: 'hidden',
        margin: '0 auto',
        background: 'rgba(210, 52, 41, 1)',
        position: 'relative',
      }}
    >
      {/* Decorative slice.png on the bottom left */}
      <div style={{
        position: 'absolute',
        left: 0,
        bottom: 0,
        width: '133.24px',
        height: '134.95px',
        background: 'rgba(210, 52, 41, 1)',
        zIndex: 1,
        pointerEvents: 'none',
        userSelect: 'none',
        display: 'flex',
        alignItems: 'flex-end',
      }}>
        <img
          src="/slice.png"
          alt="Decorative Slice"
          style={{
            width: '133.24px',
            height: '134.95px',
            display: 'block',
          }}
        />
      </div>
      <Frame70 />
    </div>
  );
};

export default Banner;
